import React from 'react';
import HomePage from './pages/homepage/homepage.component';
import {Route} from 'react-router-dom';
import './App.css';

const HatsPage = () => (
  <div>
    <h1>Hats Page</h1>
  </div>
);

function App() {
  return (
    <div>
        <Route path='/'  component={HomePage} />
        <Route path='/HatsPage' component={HatsPage} />

    </div>
  );
}

export default App;
